import React, { Component } from 'react';
import Connexion from './Connexion';
import PageAccueil from './PageAccueil';
import Enregistrement from './Enregistrement'
import Utilisateur from './Utilisateur'

class Main extends Component {
    constructor() {
        super();
        this.state = {
            isConnected : 'connexion'
        }
        this.changePage = this.changePage.bind(this);
    }

    changePage(etat) {
        this.setState({isConnected : etat});
    }

    render() {
        if (this.state.isConnected === 'main') {
            return <PageAccueil changePage = {this.changePage}/>
        }
        if (this.state.isConnected === 'connexion') {
            return <Connexion changePage = {this.changePage}/>
        }
        if (this.state.isConnected === 'inscription') {
            return <Enregistrement changePage={this.changePage} />
        }
        if (this.state.isConnected === 'utilisateur') {
            return <Utilisateur changePage={this.changePage} />
        }
    }
}

export default Main;
